This step verifies the proof we have just created. The verification is supposed to be run at any time after the proof has been created and when we want to make sure our proof is valid as well as retrieving information out from the proof kvCH, rpCH, errCH := api.VerifyTrieProof(ctx, cli, id, triePf.GetId(), true, "proof.dot") // strip the anchor trie part from each key
kvCH = api.InterceptKeyValueStream(ctx, kvCH, api.StripCompoundKeyAnchorTriePart) log.Println("key-values contained in the proof:")
for kv := range kvCH { log.Printf("\t%s -> %s\n", strutil.String(kv.Key), strutil.String(kv.Value))
} // always check error from the error channel
err = <-errCH
if err != nil { return err
} rp := <-rpCH
if !rp.GetVerified() { return fmt.Errorf("falsified proof: %s", rp.GetError())
} log.Printf("the proof with a root hash of %s is anchored to %s in block %v with transaction %s at %s, which can be viewed at %s\n", triePf.GetProofRoot(), triePf.GetAnchorType(), triePf.GetBlockNumber(), triePf.GetTxnId(), time.Unix(int64(triePf.GetBlockTime()), 0).Format(time.UnixDate), triePf.GetTxnUri(),
